import React from 'react';
import ReactDOM from 'react-dom';
import Nav,{Card} from "./cards";
import Arr from "./cardsarr";
const rof = (val,i) =>{
    return (<>
        i=i+2;  
        <Card imgsrc={val.imgsrc} link={val.link} name={val.name}/>


    </>
    );
}
ReactDOM.render(<>
    <Nav/>
    <div className="ashu">
    Arr.map(rof);





    </div>
    </>,document.getElementById("root"));

